import './App.css';
import Die from './Components/Die';

function App() {
  return (
    <div className="App">
      <Die face="one"/>
      <Die face="two"/>
      <Die face="three"/>
      <Die face="four"/>
      <Die face="five"/>
      <Die face="six"/>
    </div>
  );
}

export default App;
